import React from 'react';

const Footer = ({ height, pageOffset, startHeight }) => (
    <div className="footer" style={{ height}}>
        <div className="footer__content" style={{top: `${startHeight}px`, transform: `translateY(${pageOffset}px)translateX(-50%)`}}>
            <h3>Get in touch!</h3>
            <p>howdy@jonathan.co.nz</p>
        </div>
    </div>
)

export default Footer;
